			sub REG_pivotVal, REG_mem_i, $t0 -< jneg left_loop;
				sub $NFOUR, REG_i, REG_i; //With delayed branch
		}

		//while (pivot < a[j]) j -= 4; j -= 4;
		right_loop
		{
			mr 0, REG_j, REG_mem_j;
			sub REG_mem_j, REG_pivotVal, $t0 -< jneg right_loop;
				sub REG_CONST4, REG_j, REG_j; //With delayed branch
		}

		//if (i-4 >= j+4)=(i-8 >= j)=(i-j-8 >= 0)=(i-j-8 > -4)=(i-j-4 > 0)=((j-i)+4 < 0)) break;
		sub REG_i, REG_j, $t0;
		sub $NFOUR, $t0, $t0 -< jneg end;
			sub $Z, $t0, $t0;

		//tmp = a[i-1]; a[i-1] = a[j+1]; a[j+1] = tmp;
		mw +2, REG_i, REG_mem_j;

		//i++; j--; (not needed)
		//sub $NFOUR, REG_i, REG_i;
		//sub REG_CONST4, REG_j, REG_j;
	
		sub $Z, $INC, $t0 -< jneg loop;
			mw -2, REG_j, REG_mem_i;
	}

end:
stack_push:
	//save registers (restored the next quick() finishes)
	sub REG_CONST12, $sp, $sp;
	mw 0, $sp, ARG_right; //push right
	mw 2, $sp, REG_j; //push j
	t0scope
	{
		sub $DEC, $Z, $t0;
		mw 4, $sp, $t0; //push return address (-1)
	}

	//quicksort(a, left, i - 1);
	sub REG_CONST4, REG_i, ARG_right;
	sub $Z, $INC, $t1 -< jneg quick; 
		sub REG_CONST4, ARG_right, ARG_right;

return_left:
	//save registers (restored the next quick() finishes)
	sub REG_CONST12, $sp, $sp;
	//mw 0, $sp, ARG_right;
	//mw 2, $sp, REG_j;
	t0scope
	{
		sub $Z, $Z, $t0;
		mw 4, $sp, $t0; //push return address (0)
	}
	
	//quicksort(a, j + 1, right);
	sub $NFOUR, REG_j, ARG_left;
	sub $Z, $INC, $t1 -< jneg quick;
		sng4 $NFOUR, ARG_left, ARG_left;

return_right:
stack_pop:
	//Restore registers (saved before quick() is called)
	mr 0, $sp, ARG_right; //pop right
	mr 2, $sp, REG_j; //pop last
	mr 4, $sp, $ra; //pop return address
	sub REG_CONST12, $Z, $t0;

	//Branch by return address
	sub $Z, $ra, $ra -< jneg return_left;
		sub $t0, $sp, $sp;
	sub $DEC, $ra, $ra -< jneg return_right;
		sub $Z, $t1, $t1;
	//Delay branch slot
HALT:
	sub $Z, $INC, $ra -< jneg HALT;
		sub $Z, $t1, $t1;
}
}

